import React from 'react';
import DateAndTime from './DateAndTime';


class Main extends React.Component {

    render() { 
        return ( 
<main className="content">
<div className="main">
<h1>Bake More</h1>
<hr/>
<h3>Reservation</h3>
<DateAndTime />


</div>
</main>

);
}
}

export default Main;
